import React, { Component } from "react";

import "./App.css";

class App extends Component {
  state = {
    logoName: ["logo", "Andrew"],
  };
  render() {
    return (
      <div className="App">
        <header>
          <div>Logo</div>
          <nav class="nav justify-content-center"></nav>
        </header>
      </div>
    );
  }
}

export default App;
